import React from "react";
import Nav from "./Nav"
import "./Header.css"
import bluehiteLong from '../../img/blueWhiteLong.png'

const Header = () => {
    return(
        <div className = "header">
            <Nav />
            <div className ="header-theme">
                <div className='whiteLong'>
                    <img src={blueWhiteLong} alt="Logo" />
                </div>
            </div>
        </div>
    )
}
export default Header;
